            "long_description": "agex IT- Die Agentur f\u00fcr Experten\n\nIhre IT- und Engineering-Projekte. Unser Know-how. Professionell und sicher.\n\nUnsere Expertise\n\nAls kompetenter Partner im Besetzen von IT-Software- und Engineering-Projekten hat sich unser Unternehmen seit 2007 am Markt etabliert. Was dahinter steckt? 20 Jahre Branchenerfahrung der Gr\u00fcnderinnen in den verschiedensten Bereichen von Industrie und Wirtschaft. Ein qualitativ hochwertiges Netzwerk an freiberuflichen und angestellten Spezialisten. Und: wir setzen auf langj\u00e4hrige und erfolgreiche Gesch\u00e4ftsbeziehungen. Das erm\u00f6glicht uns, die Anforderungen unserer Kunden zu erkennen und bedarfsgerecht zu liefern. \n\nUnsere Gesch\u00e4ftsprozesse sind nach DIN EN ISO 9001:2015 zertifiziert. \n\nWir sind pers\u00f6nlich engagiert, fachlich kompetent und zu 100 % verbindlich. \n\nVon unserer Berliner Firmenzentrale steuern wir unser Unternehmen \u2013 aus dem Herzen der Hauptstadt direkt am Gendarmenmarkt.  Von hier aus betreut unser Team operativ und administrativ die Projekte und Anliegen unserer Kunden, Gesch\u00e4ftspartner und Mitarbeiter.\n\n\nUnser Beitrag\n\n\u2022\tUnternehmens- und Personalberatung\n\u2022\tProfessionelle Vermittlung und Beauftragung von IT-Experten im Rahmen von Dienstvertr\u00e4gen \n\u2022\tDurchf\u00fchrung von Entwicklungsauftr\u00e4gen im Rahmen von Werkvertr\u00e4gen\n\u2022\t\u00dcberlassung von Mitarbeitern im Rahmen der Arbeitnehmer\u00fcberlassung \n\nUnsere Onlinepr\u00e4senz\n\n\u2022\thttps://www.agex-it.de\n\u2022\thttps://www.xing.com/companies/agexitgmbh\n\u2022\thttps://twitter.com/agex_IT\n\n\n\nagex IT GmbH\nTaubenstra\u00dfe 20-22\n10117 Berlin\n\nFon  +49 (0)30 832 157 200 \nFax   +49 (0)30 832 157 2015\nMail  resourcer@agex-it.de\n",
            "seo_description": "agex ist Ihr strategischer Partner, wenn es um die Besetzung von IT-Projekten geht. Vertrauen Sie auf unsere IT-Skills und setzen Sie auf 20 Jahre Erfahrung.",
