            "long_description": "Als Technologieunternehmen des Bundes widmen wir uns mit gro\u00dfer Leidenschaft einem der zentralen Themen des 21. Jahrhunderts: Produkte und L\u00f6sungen rund um sichere Identit\u00e4ten, Daten und Infrastruktur. Ob es darum geht, Personen zweifelsfrei zu identifizieren oder die Sicherheit sensibler Daten, Dokumente und Informationen zu gew\u00e4hrleisten: Wir sind der Innovationstreiber in Sachen Hochsicherheitstechnologie, auf dessen Produkte und Dienstleistungen \"Made in Germany\" Unternehmen, Staaten und Beh\u00f6rden vertrauen. Damit verbunden ist eine Arbeitswelt, wie sie spannender und vielf\u00e4ltiger kaum sein k\u00f6nnte. Wir laden Sie herzlich ein, ein wichtiger Teil von ihr zu werden. Bleiben Sie auf dem Laufenden mit unserem Newsletter: https://www.bundesdruckerei.de/de/newsletter\n\nDie Bundesdruckerei-Gruppe ist eines der traditionsreichsten Unternehmen der Branche mit einer mehr als 250-j\u00e4hrigen Geschichte. Von jeher sind unsere Markenzeichen das Vertrauen der Kunden sowie h\u00f6chste Sicherheit von Prozessen und Produkten: Wir erfassen, verwalten und verschl\u00fcsseln nicht nur sensible Daten, entwickeln Software und automatische Grenzkontrolll\u00f6sungen - zudem produzieren, verwalten und versenden wir beh\u00f6rdliche Dokumente, Pass- und Ausweissysteme sowie Banknoten, Postwert- und Steuerzeichen. Entsprechend bunt gemischt ist unser Team, in dem schon heute rund 4.000 Mitarbeiter ihr berufliches Zuhause gefunden haben: in unserem Hauptsitz mitten in Berlin und an unseren Standorten in Hamburg, Hannover, M\u00fcnchen, Leipzig und Bonn.\n\nUnd jetzt kommen Sie! Um als Berufseinsteiger oder Professional einen Arbeitgeber f\u00fcr sich zu entdecken, der Sie \u00fcberraschen wird. \n\nImpressum: https://www.bundesdruckerei.de/de/impressum \nDatenschutz: https://www.bundesdruckerei.de/de/datenschutz",
