            "long_description": "MISSION\n\nWe imagine a new world. A world where people freely unfold their talents. A world in which talented people from outside Europe move effortlessly towards opportunity. A world in which Europe is a beacon of light and opportunity for young global talent.\n\n_____________\n\nABOUT US\n\nWe are a social organization based in Berlin.\nWe are all volunteers connected by one purpose: having a positive impact on people's lives.\nWe do not engage in political or religious activities.\nWe connect IT talent from MENA countries & beyond with the opportunity to advance global equality.\n\n_____________\n\nJOIN THE MOVEMENT\n\nBecome a volunteer: https://joinimagine.com/team\nSupport our mission: https://joinimagine.com/Mission\nHire our Fellows: imagine-fellows.com\nSubscribe to our newsletter: https://joinimagine.substack.com/\n____________\n\nARE YOU A TECH OR PRODUCT ENTHUSIAST?\n\nFull Stack, Front End, Backend, Mobile, DevOps, QA or Data scientist, Product Manager, System Engineer or Engineer Manager? \nJoin our digital boot camp and find your dream job in Europe.\n\nTo learn more, visit joinimagine.com and APPLY NOW: https://www.joinimagine.com/applynow\n\n____________\n\nFAQ\n\nhttps://www.joinimagine.com/faq",
