            "long_description": "Since AirHelp was founded in 2013, we\u2019ve helped millions of people get paid compensation for their delayed or canceled flights. We\u2019re proud of our excellent rating from hundreds of thousands of reviews on Trustpilot, and our status as the No.1 worldwide for flight compensation.\n\nWe make claiming compensation easy for travelers who are unsure of their rights and lack the time or expertise to embark on the claims process alone. Great people and smart tech help us build a seamless customer journey and ensure that we're at the top of our game with an incredible success rate. \n\nOur annual membership service AirHelp+ has had millions of purchases. It offers members fast payouts and lounge access when disruptions occur, and protects them against other unexpected flight problems. AirHelp+ is our way of giving passengers the best, smoothest travel experience possible. \n\nOur global team of over 400 provides 24/7 support to our customers in 19 languages. This, combined with the local knowledge from our network of over 50 law firms\u2013the largest network in the world specializing in air passenger rights\u2013makes us uniquely placed to help air passengers anywhere, anytime. \n\nWhat\u2019s more? We\u2019re so proud of our status as a Most Loved Workplace, a prestigious award that underscores our dedication to prioritizing well-being, as well as cultivating a working environment that encourages personal growth and ownership. We ranked 21st on Newsweek\u2019s list of the Most Loved Workplaces 2024. We also received additional awards for being a Most Loved Workplace for women, the LGBTQ+ community, and young professionals, meaning that AirHelp isn\u2019t just a great place to work, but a truly lovable one. \ud83c\udf89",
