            "long_description": "Circula is building the #1 Employee Spend Management platform in Europe.\n\nWe combine travel and expense management, corporate credit cards and employee benefits in an all-in-one software solution, creating the first truly employee-centric SaaS product in Europe. \n\nWith Circula, companies are advancing the digitalization of their accounting processes around \ud835\ude01\ud835\uddff\ud835\uddee\ud835\ude03\ud835\uddf2\ud835\uddf9 \ud835\uddf0\ud835\uddfc\ud835\ude00\ud835\ude01\ud835\ude00 \ud835\uddee\ud835\uddfb\ud835\uddf1 \ud835\uddf2\ud835\ude05\ud835\uddfd\ud835\uddf2\ud835\uddfb\ud835\ude00\ud835\uddf2\ud835\ude00, creating flexibility and efficiency across the team. From travel booking, easy submission via app and automated VMA calculation to DATEV export \u2013 the process is not only intuitive, digital and legally compliant, but also saves around 80 % of time compared to manual processes. \n\nAdditionally, Circula offers employees benefits that are really attractive \u2013 in this way you not only increase your employer brand, but also demonstrate appreciation to your existing employees. Lunch Benefit, Mobility Benefit, Voucher Benefit, Internet Benefit, and Relax Benefit: all benefits modules work tax-optimised, digitally and without additional effort for the HR department. \n\nToday, more than 1,500 companies such as McMakler, Lilium, DATEV and Securitas use our solution to solve employee finances easily and time-efficiently. \n\nThe company was founded in 2017 and is backed by renowned investors Alstin Capital, Capnamic Ventures, Storm Ventures, Peak, HW Capital, Wenvest Capital and Main Incubator.",
