            "long_description": "Thryve ist dein zuverl\u00e4ssiger Tech Recruiter in Deutschland. Wir vermitteln hochkar\u00e4tige Tech Talents an aufstrebende Unternehmen im Digital- und IT-Bereich. \n\nDaf\u00fcr machen wir uns neueste Recruiting Technologien und unser schnell wachsendes Talents Netzwerk zu Nutze. Kund:innen vertrauen auf uns, weil wir f\u00fcr ihre \u2013 oft komplexen \u2013 Stellenprofile in kurzer Zeit die besten Kandidat:innen liefern.\n\nVon unseren B\u00fcros in Berlin und London aus treiben wir seit 2014 die Tech Recruiting Branche voran. Entdecke jetzt die passenden L\u00f6sungen von THRYVE f\u00fcr dein Unternehmen.\n\nMehr unter: www.thryvetalent.com\n\nOder nimm direkt Kontakt mit uns auf.  Wir w\u00fcrden uns freuen, von dir zu h\u00f6ren. \n\nLondon: +44 (0)204 586 7451\n\nBerlin: +49 (0)30 917 33681 \n\nE-Mail: info@thryvetalent.com\n\nPS: London is always calling \u2013 und bei Thryve London ruft dein Traumjob nach dir! Was du daf\u00fcr nicht brauchst: Deutsche Sprachkenntnisse. WAS du brauchst: Motivation und Hunger aufs Karriere machen mit uns.\n\n++++++++\n\nThryve is your reliable tech recruiter in Germany. We place high-caliber tech talents with up-and-coming companies in the digital and IT sector.\n\nWe use the latest recruiting technologies and our fast-growing talent network. Clients rely on us because we deliver the best candidates for their \u2013 often complex \u2013 job profiles in a short time.\n\nFrom our offices in Berlin and London, we have been driving the tech recruiting industry forward since 2014. \n \nCheck our website for more details: www.thryvetalent.com \n\nOr contact us directly.  We'd love to hear from you.\n\nLondon: +44 (0)204 586 7451\n\nBerlin: +49 (0)30 917 33681\n\nE-Mail: info@thryvetalent.com\n \nPS: London is always calling \u2013 and at Thryve London your dream job is calling for you! What you don't need: German language skills. WHAT you need: Motivation and hunger for a career with us.",
