            "long_description": "Wir sind eine auf IT spezialisierte Personalberatung mit Sitz im Herzen von Berlin. Wir vermitteln ausschlie\u00dflich unbefristete Festanstellungen und betreuen eine Vielzahl von Unternehmen; von kleinen & mittelst\u00e4ndischen Unternehmen bis hinzu den gr\u00f6\u00dften Arbeitgebern in Berlin. \n\nJahrelange Erfahrung in gro\u00dfen Personalvermittlungen und im Beratungsumfeld in der Industrie haben uns mit dem n\u00f6tigen Knowhow- und mit Ideen ausgestattet, wie wir Bewerber, wie auch Unternehmen gut beraten und betreuen k\u00f6nnen. \n\nAls inhabergef\u00fchrtes Unternehmen haben wir bei Hirebird die Freiheit, einen deutlich gr\u00f6\u00dferen Fokus auf individuelle Anforderungen und Gegebenheiten zu setzen. \n\nBei Hirebird bringen erfahrene Personalberater durch beste Vernetzung Softwareentwickler und Unternehmen im Gro\u00dfraum Berlin zusammen. Mit Seriosit\u00e4t, Erfahrung, Diskretion und intensiver Beratung begleiten wir Sie durch die Bewerbungsphase. Unsere Prozesse sind transparent und Sie bekommen immer offenes Feedback, damit Sie wissen wo Sie stehen.\n\nF\u00fcr Bewerber ist dieser Service kostenlos.\n\nIhr Datenschutz ist uns sehr wichtig: Selbstverst\u00e4ndlich werden all Ihre Daten streng vertraulich und diskret behandelt. Mit der Zusendung Ihrer Unterlagen stimmen Sie zu, dass diese bei uns gespeichert- und nur nach Ihrer ausdr\u00fccklichen Zustimmung an unsere Mandanten weitergegeben werden. Weitere Details hierzu k\u00f6nnen Sie in unseren Datenschutzbedingungen unter https://www.hirebird.io/datenschutz jederzeit einsehen. Bei Fragen wenden Sie sich gern jederzeit an Ihren Hirebird Personalberater oder an meinedaten@hirebird.de.\n\nhttps://hirebird.io/impressum",
